//scf
const Block = (props) => {

    this.props = props;
    return (

        <section>

            <article>
                <img src="" alt="" />
            </article>
            <article>
                <h3>this.props.title</h3>
                <p></p>
            </article>

        </section>
    );
}

export default Block;
